ReactDOM.render(
  <>
    <h1 className='heading_style'>List of Top 5 series in Netflix</h1>
    {Series.map((val,index)=>{
      return(
        <Card
      imgsrc={val.imgsrc}
      title={val.title}
      sname={val.sname}
      link={val.link} />

      )
    })}


  </>,
  document.getElementById('root'));
